Patch Set 9:

With this change, Qt Quick tests start asserting. The assert fires for this example, which I think is close to what we see in Qt Quick.

Until we have figured this out, I vote for a revert of this change lest we block qtdeclarative dependency updates for a potentially long time. I understand the problem, but I don't think this is the right solution.

#include <QtCore>
class Object1 : public QObject
{
    Q_OBJECT
public:
    Object1()
    {
    }
    ~Object1()
    {
        emit somethingChanged();
    }
signals:
    void somethingChanged();
protected:
    void slot1() {
        qDebug() << this << "slot1";
    }
};

class Object2 : public Object1
{
    Q_OBJECT
public:
    Object2()
    {
        connect(this, &Object1::somethingChanged, this, &Object2::slot2);
    }
protected:
    void slot2() {
        qDebug() << this << "slot2";
    }
};
int main(int argc, char **argv)
{
    QCoreApplication app(argc, argv);
    {
        Object2 obj;
    }
}
#include "main.moc"

Patch Set 9:

> As for the string-based connection, there is no check. The difference is in delivery, because it uses the virtual qt_metacall(). Unfortunately, the cost of that is equivalent to the cost of indirect pointer call to QSlotObject::impl.

Actually, qobject.cpp:doActivate has three outcomes. One is the QSlotObject:

            if (c->isSlotObject) {
                SlotObjectGuard obj{c->slotObj};

                {
                    Q_TRACE_SCOPE(QMetaObject_activate_slot_functor, c->slotObj);
                    obj->call(receiver, argv);
                }

obj->call() is inline and just places an indirect call via the m_impl function pointer.

The third is the regular metacall I was talking about:

                    QMetaObject::metacall(receiver, QMetaObject::InvokeMetaMethod, method, argv);

int QMetaObject::metacall(QObject *object, Call cl, int idx, void **argv)
{
    if (object->d_ptr->metaObject)
        return object->d_ptr->metaObject->metaCall(object, cl, idx, argv);
    else
        return object->qt_metacall(cl, idx, argv);
}

But there's a second one that is an optimisation:

            } else if (c->callFunction && c->method_offset <= receiver->metaObject()->methodOffset()) {
                //we compare the vtable to make sure we are not in the destructor of the object.
...
                    callFunction(receiver, QMetaObject::InvokeMetaMethod, method_relative, argv);


The callFunction is a pointer to the qt_static_metacall function, which is the body of the qt_metacall without the chaining to parent class. See QCoreApplication:

int QCoreApplication::qt_metacall(QMetaObject::Call _c, int _id, void **_a)
{
    _id = QObject::qt_metacall(_c, _id, _a);
    if (_id < 0)
        return _id;
    if (_c == QMetaObject::InvokeMetaMethod) {
        if (_id < 8)
            qt_static_metacall(this, _c, _id, _a);
        _id -= 8;

As you can see, we've had to deal with this problem in the past, which is why that comment and the method_offset check are present. But that optimisation is safe *because* we have the slot's method_offset. There's no such number for slot objects.

I was going to suggest we simply get the metaobject's own slot offset, but that won't work because the number will be equal to the parent's meta object if this class has no new signals or slots. In any case, that QMetaObject::methodOffset() call is going to be as expensive as QMetaObject::inherits(). So the only solution I can think of is what I said before: record the meta object current for the receiver at the time of the connect() and ensure that it doesn't get destroyed past that during signal activation.
